import React, { useEffect, useState } from 'react';
import { BrowserRouter, Routes, Route, Navigate } from 'react-router-dom';

// components & other files
import Test from './pages/Test';

function App() {
  

  return (
    <BrowserRouter>
      <Routes>
        <Route path='/test' element={<Test />} />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
